import React from 'react';
import logo from './logo.svg'

class Header extends React.Component {
    render(){
        return (
            <header className="header">
                <Link><img src={logo} /></Link>
                <nav className="headerNavMenu">
                    <Link></Link>
                </nav>
            </header>
        )
    }
}

export default Header;
